　人気絵本『くまのがっこう』の子供用長靴です。<br>中敷きにはブランドロゴとサイズ表記入り。<br>お名前シールがついています。<br><br>■サイズ：15cm/16cm/17cm/18cm <br>ソールの厚さ：約0.5cm（ヒールを除く）<br>■重量：15cm/470g　16cm/500g　17cm/540g　18cm/570g<br>■備考：<br>素材・成分：塩化ビニル（PVC)、中敷/パイル地<br>生産地：中国<br>パッケージ：個別箱入り<br>製造年：2013<br><br>【使用時のご注意】<br>・ご自分の足型に合ったサイズ・形状の物をお選び下さい。合わない物を長時間使用すると健康をそこなう事があります。<br>・ご使用中の発汗等により、かゆみ・かぶれ等異常が発生した時は、直ちにご使用を中止して下さい。<br>・濡れた床面等、滑りやすい所では、スリップに十分ご注意下さい。<br><br>【お取り扱い上のご注意】<br>・火のそばに置くと、軟化又は変形する事があります。<br>・乾燥する時は、陰干しにして下さい。<br>・油のひいてある場所でのご使用は、お避け下さい。<br>【サンマルコ】<!--関連商品--><br><div class=reltitle> </div><div class=relink><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image6/490673612.jpg?_ex=80x80 border=0><div class=rel_name>サンマルコ 【2014年NEW】　レインハット　くまのがっこう　ピンク </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image6/4906736125.jpg?_ex=80x80 border=0><div class=rel_name>サンマルコ 【2014年NEW】　レインハット　くまのがっこう　イエロー </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image6/4906736131.jpg?_ex=80x80 border=0><div class=rel_name>サンマルコ 【2014年NEW】　くまのがっこう　レインブーツ　長靴　イエロー </div></div><div class=rel_waku><img src=http://thumbnail.image.rakuten.co.jp/@0_mall/orange-baby/cabinet/image6/4906736133110.jpg?_ex=80x80 border=0><div class=rel_name>サンマルコ 【2014年NEW】　入学準備　子供傘　50cm　くまのがっこう　水玉総柄生地の子供傘 </div></div></div><!--/関連商品--><br>※沖縄・一部地域へのお届けは別途送料を申し受けます。<link href="http://www.rakuten.ne.jp/gold/orange-baby/css/style_ie.css" rel="stylesheet" type="text/css">



